"   <div id=\"basicsTopicLeft\">",
"    <div id=\"topicTitle\">",
"     Patient information: Blood in the urine (hematuria) in adults (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/blood-in-the-urine-hematuria-in-adults-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H294739703\">",
"      <span class=\"h1\">",
"       Should I be worried if there is blood in my urine?",
"      </span>",
"      &nbsp;&mdash;&nbsp;It can be scary to see blood in your urine. But try to stay calm. Blood in the urine is not usually serious. Still, it is important to see a doctor or nurse. The medical term for blood in the urine is &ldquo;hematuria.&rdquo;",
"     </p>",
"     <p>",
"      Blood in the urine can come from the kidneys (where urine is made) or anywhere in the urinary tract (",
"      <a class=\"graphic graphic_figure graphicRef79864 \" href=\"UTD.htm?26/28/27072\">",
"       figure 1",
"      </a>",
"      ).",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H294739710\">",
"      <span class=\"h1\">",
"       What causes blood in the urine?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Blood in the urine can be caused by lots of problems, including:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Bladder infection, which often also causes burning or pain when you urinate",
"       </li>",
"       <li>",
"        Kidney infection, which often also causes back pain and fever",
"       </li>",
"       <li>",
"        Kidney stones, which usually also cause back pain",
"       </li>",
"       <li>",
"        Certain kidney diseases",
"       </li>",
"       <li>",
"        Intense exercise",
"       </li>",
"       <li>",
"        Injury (for example, if you fall off a bike and bruise a kidney)",
"       </li>",
"       <li>",
"        Enlargement of the prostate (called &ldquo;benign prostatic hyperplasia&rdquo;), which is common in older men",
"       </li>",
"       <li>",
"        Cancer of the bladder, prostate, or kidney (cancer is an uncommon cause of blood in the urine, and it usually affects people older than 50)",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      Sometimes, urine can look as though it is bloody even though it isn&rsquo;t. This can happen if you eat a lot of beets or food dyes, or if you take certain medicines.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H294739717\">",
"      <span class=\"h1\">",
"       Should I see a doctor or nurse?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. See your doctor or nurse if you see blood in your urine, or if your urine is pink, red, brownish-red, or the color of tea.",
"     </p>",
"     <p>",
"      Sometimes, doctors find blood in the urine when they do a routine urine test. That can happen even if the urine looks normal. It means there are microscopic (trace) amounts of blood in the urine.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H294739724\">",
"      <span class=\"h1\">",
"       Which tests should I have?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Your doctor or nurse will decide which tests you should have based on your age, other symptoms, and individual situation. There are lots of tests, but you might not need any.",
"     </p>",
"     <p>",
"      Here are the most common tests doctors use to find the cause of blood in the urine:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        <strong>",
"         Urine tests",
"        </strong>",
"        &mdash; Urine tests can show what kind of cells are in the urine. This can hold clues about what might be going wrong.",
"       </li>",
"       <li>",
"        <strong>",
"         Blood tests",
"        </strong>",
"        &mdash; Blood tests can show whether your kidneys are working normally, or if you might have certain diseases.",
"       </li>",
"       <li>",
"        <strong>",
"         CT scan",
"        </strong>",
"        &mdash; A CT scan is a special kind of X-ray. It creates a picture of the kidneys and urinary tract. Doctors can use it to check for kidney stones and other problems in the urinary tract.",
"       </li>",
"       <li>",
"        <strong>",
"         Kidney ultrasound",
"        </strong>",
"        &mdash; A kidney ultrasound is another way to create a picture of the kidneys. Doctors sometimes use ultrasound instead of a CT scan.",
"       </li>",
"       <li>",
"        <strong>",
"         Cystoscopy",
"        </strong>",
"        &mdash; Cystoscopy is a procedure that allows the doctor to look inside the bladder. To do a cystoscopy, the doctor inserts a small tube into the urethra, the tube through which urine leaves the body. Then he or she threads the tube up into the bladder. The tube has a tiny camera that projects images of the bladder onto a screen. If the doctor sees anything unusual, he or she might take a sample of tissue (biopsy) to look at under the microscope.",
"       </li>",
"       <li>",
"        <strong>",
"         Kidney biopsy",
"        </strong>",
"        &ndash; During a kidney (renal) biopsy, the doctor takes a small sample of tissue from the kidney to look at under the microscope. The most common way to get the sample is by inserting a needle straight through the skin in the back and into the kidney.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H294739731\">",
"      <span class=\"h1\">",
"       Should I be treated?",
"      </span>",
"      &nbsp;&mdash;&nbsp;That depends on what seems to have caused the blood in your urine. If you had blood in your urine because you exercised too intensely or because your kidney was bruised, you might not need any treatment. On the other hand, if you have blood in the urine because of a bladder or kidney infection, you will probably need antibiotics.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H294739738\">",
"      <span class=\"h1\">",
"       More on this topic",
"      </span>",
"     </p>",
"     <p>",
"      <a class=\"medical medical_basics\" href=\"UTD.htm?16/51/17202?source=see_link\">",
