"      </a>",
"      <br/>",
"      <a class=\"medical medical_basics\" href=\"UTD.htm?19/47/20210?source=see_link\">",
"       Patient information: Urinary tract infections in adults (The Basics)",
"      </a>",
"      <br/>",
"      <a class=\"medical medical_basics\" href=\"UTD.htm?15/21/15698?source=see_link\">",
"       Patient information: Benign prostatic hyperplasia (enlarged prostate) (The Basics)",
"      </a>",
"      <br/>",
"      <a class=\"medical medical_basics\" href=\"UTD.htm?42/56/43905?source=see_link\">",
"       Patient information: Kidney stones in adults (The Basics)",
"      </a>",
"      <br/>",
"      <a class=\"medical medical_basics\" href=\"UTD.htm?36/31/37363?source=see_link\">",
"       Patient information: Glomerular disease (The Basics)",
"      </a>",
"     </p>",
