"   </div>",
"   <div class=\"lgnd\">",
"    Mechanism of labor for right mentoposterior position with subsequent rotation of the mentum anteriorly&nbsp;followed by&nbsp;delivery.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
