var title_f22_59_23483="Terminology developmental dysplasia of the hip";
var content_f22_59_23483=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PEDS%2F88588&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=0\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PEDS%2F88588&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=0\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Terminology for developmental dysplasia of the hip",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Term",
"       </td>",
"       <td class=\"subtitle1\">",
"        Definition",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Dislocation",
"       </td>",
"       <td>",
"        Complete loss of contact between the femoral head and the acetabulum.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Subluxation",
"       </td>",
"       <td>",
"        The femoral head is partially outside of the acetabulum but remains in contact with it.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Dislocatable",
"       </td>",
"       <td>",
"        The femoral head is reduced (ie, within the acetabulum) at rest, but can dislocate in other positions or with examination maneuvers. This is a hip with",
"        <strong>",
"         instability",
"        </strong>",
"        .",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Subluxatable/subluxable",
"       </td>",
"       <td>",
"        The femoral head is reduced at rest but can be partially dislocated or subluxated with examination maneuvers. This is a hip with",
"        <strong>",
"         mild instability or laxity",
"        </strong>",
"        .",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Reducible",
"       </td>",
"       <td>",
"        The hip is dislocated at rest, but the femoral head can be positioned into the acetabulum with manipulation (generally flexion and abduction).",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Dysplasia",
"       </td>",
"       <td>",
"        Abnormality of the shape of the hip joint (usually shallowness of the acetabulum, involving the superior and anterior margins).",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
