var title_f22_59_23484="Tumor skull base synd";
var content_f22_59_23484=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ONC%2F64650&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=3\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ONC%2F64650&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=3\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Tumor-related base of skull syndromes in cancer patients",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tr>",
"      <td class=\"subtitle1\">",
"       Syndrome",
"      </td>",
"      <td class=\"subtitle1\">",
"       Characteristics",
"      </td>",
"     </tr>",
"     <tr>",
"      <td rowspan=\"2\">",
"       Orbital syndrome",
"      </td>",
"      <td>",
"       Increasing pain in the retroorbital and supraorbital regions of the affected eye",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Associated problems include blurred vision, diplopia, proptosis, chemosis (conjunctival edema), external ophthalmoplegia, ipsilateral papilledema, and decreased sensation in the ophthalmic division of the trigeminal nerve",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Parasellar syndrome",
"      </td>",
"      <td>",
"       Neoplastic invasion in the parasellar region can lead to unilateral supraorbital and frontal headache, as well as diplopia",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Middle cranial fossa syndrome",
"      </td>",
"      <td>",
"       Pain and sensory changes in the distribution of the mandibular and maxillary divisions of the trigeminal nerve. May be associated with headache, diplopia, dysarthria, dysphagia, facial numbness, paresthesias, or pain referred to the cheek or jaw.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td rowspan=\"2\">",
"       Jugular foramen and hypoglossal syndrome",
"      </td>",
"      <td>",
"       Afffects the glossopharyngeal, vagus, and accessory nerves. Throat pain, hoarseness, dysphasia, deep aching in the ipsilateral mastoid region, and glossopharyngeal neuralgia with or without bradycardia and syncope.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Neurological signs may include Horner's syndrome and weakness of the palatal muscles, sternocleidomastoid, or trapezius muscles",
"      </td>",
"     </tr>",
"     <tr>",
"      <td rowspan=\"3\">",
"       Occipital condyle syndrome",
"      </td>",
"      <td>",
"       Presents with severe unilateral occipital pain that is worsened by neck flexion, neck stiffness",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Almost always includes concomitant involvement of hypoglossal canal leading to paresis and atrophy of ipsilateral tongue",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Physical examination may reveal head tilt, limited movement of neck, tenderness to palpation over occipito-nuchal junction",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Clivus syndrome",
"      </td>",
"      <td>",
"       Severe headache maximally experienced at vertex and worse with neck flexion, sixth nerve palsy",
"      </td>",
"     </tr>",
"     <tr>",
"      <td rowspan=\"2\">",
"       Sphenoid sinus syndrome",
"      </td>",
"      <td>",
"       Bifrontal headache radiating to the temples and retroorbital areas",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       May present with associated nasal congestion and diplopia from sixth nerve palsy",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Fracture of the odontoid process (dens)",
"      </td>",
"      <td>",
"       Posterior headache, worse on neck flexion. Instability of the cervical spine or mass effect from tumor may cause spinal cord or brainstem compression.",
"      </td>",
"     </tr>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
